/**
 * @name parsing
 * @author JungHyunKwon
 * @since 2017-12-06
 * @version 1.0.0
 * @param {string} value
 * @param {string} from
 * @param {string} to
 * @param {number} index
 * @return {string}
 */
try{!function(){"use strict";window.parsing=function(n,r,i,t){var e="";if("string"==typeof n){var f=n.indexOf(r,t);if(f>-1){var o=f+r.length,s=n.indexOf(i,o);s>-1&&(e=n.substring(o,s))}}return e}}()}catch(n){console.error(n)}